import React from "react";
import { BrowserRouter as Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h2>⚾️승리요정 찾기⚾️</h2>
      <nav>
        <Link to="/login">
          <button>로그인</button>
        </Link>
        <Link to="/signup">
          <button>회원가입</button>
        </Link>
      </nav>
    </div>
  );
}

export default App;
